import React from "react";
import style from "./menu.module.css";
import icon from "..//..//recsource/icons/login_14018647.png"
const Menu = () => {
    return (
        <div className={style.container}>
            <ul>
                <li>
                    <a href="/home">Home</a>
                </li>
                <li>
                    <a href="/about">About</a>
                </li>
            </ul>
            <button className={style.buttonSinIn}><img src={icon} alt="" className={style.buttonSinIn} /></button>
        </div>
    );
}

export default Menu;
